description:
Verenigd Koninkrijk / Verenigde Staten
Drama / Romantiek
115 minuten

goed

met Natalie Portman, Scarlett Johansson en Eric Bana

De zussen Boleyn denken beide de liefde van hun leven aan het kille hof van de Tudors gevonden te hebben. Maar niet alleen het 
hof blijkt onvriendelijk. De spanningen tussen beide zussen lopen hoog op, wanneer zij beiden vallen voor de charmes van Koning 
Henry VIII.
